import React, { Component } from 'react'
import Cwbstation from './Cwbstation'
export class Cwbdata extends Component {
    makeStation(){
        var output=[];
        for(let i=0;i<4;++i)
            output.push(<Cwbstation>{i}</Cwbstation>)
        return output;
    }
    render() {
        return (
            <div>
                {this.makeStation()}
            </div>
        )
    }
}
export default Cwbdata
